export default function Detail (){

    const [data, setData] = useState([])

    const {produitId}=useParams()


    useEffect(()=>{
        const fetchdata = async()=>{
            const result = await axios('http://127.0.0.1:8000/api/produits/')
            setData(result.data)
        }

        fetchdata()
    }, [])


    return(
        <>
            <p>hello</p>
            <h1>{produitId}</h1>
        </>
    )
}
